import React from "react"


function DeckList({decks}) {


const list = decks.map((deck,index) => {
    <Deck name={deck.name} description={deck.description} cards={deck.cards.length - 1}/>
})

return (
    <div>
        {list}
    </div>
)

}

export default DeckList
